import React, { useEffect, useState } from "react";
import { DATE_WISE_REPORT } from "../../apis/Apis";

const DateWiseCount = () => {
  const [counts, setCounts] = useState([]);
  const [sortField, setSortField] = useState("date");
  const [ascending, setAscending] = useState(false);

  useEffect(() => {
    fetchDateWiseReport();
  }, []);

  const fetchDateWiseReport = async () => {
    try {
      const response = await DATE_WISE_REPORT();
      setCounts(response?.data || []);
    } catch (error) {
      console.error("Failed to fetch date wise report:", error);
    }
  };

  const handleSort = (field) => {
    if (sortField === field) {
      setAscending(!ascending);
    } else {
      setSortField(field);
      setAscending(true);
    }
  };

  const getSortedData = () => {
    return [...counts].sort((a, b) => {
      const valA = a[sortField];
      const valB = b[sortField];

      if (typeof valA === "string") {
        return ascending ? valA.localeCompare(valB) : valB.localeCompare(valA);
      } else {
        return ascending ? valA - valB : valB - valA;
      }
    });
  };

  const renderSortIcon = (field) => {
    if (sortField === field) {
      return ascending ? " ‚ñ≤" : " ‚ñº";
    }
    return "";
  };

  return (
    <div className="p-8 font-sans">
      <h2 className="mb-5 text-2xl font-semibold text-gray-800">
        üìä Payment & Registration Summary
      </h2>

      <div className="overflow-hidden rounded-lg shadow-lg">
        <table className="w-full border-collapse">
          <thead>
            <tr className="bg-gradient-to-r from-gray-800 to-red-500 text-white text-center">
              <th 
                className="p-4 min-w-[130px] cursor-pointer hover:bg-opacity-90"
                onClick={() => handleSort("date")}
              >
                üìÖ Date{renderSortIcon("date")}
              </th>
              <th 
                className="p-4 min-w-[130px] cursor-pointer hover:bg-opacity-90"
                onClick={() => handleSort("registered_payment_count")}
              >
                üí∞ Payment{renderSortIcon("registered_payment_count")}
              </th>
              <th 
                className="p-4 min-w-[130px] cursor-pointer hover:bg-opacity-90"
                onClick={() => handleSort("payment_mobile_count")}
              >
                üìù Registered{renderSortIcon("payment_mobile_count")}
              </th>
              <th 
                className="p-4 min-w-[130px] cursor-pointer hover:bg-opacity-90"
                onClick={() => handleSort("refund_count")}
              >
                ‚Ü©Ô∏è Refunds{renderSortIcon("refund_count")}
              </th>
              <th 
                className="p-4 min-w-[130px] cursor-pointer hover:bg-opacity-90"
                onClick={() => handleSort("login_status_count")}
              >
                üîê Logged In{renderSortIcon("login_status_count")}
              </th>
            </tr>
          </thead>
          <tbody>
            {counts.length === 0 ? (
              <tr>
                <td colSpan="5" className="p-4 text-center text-gray-500">
                  No data available
                </td>
              </tr>
            ) : (
              getSortedData().map((item, index) => (
                <tr
                  key={index}
                  className={`${
                    index % 2 === 0 ? "bg-gray-50" : "bg-white"
                  } text-center hover:bg-gray-100`}
                >
                  <td className="p-3 border-b border-gray-100">{item.date}</td>
                  <td className="p-3 border-b border-gray-100 font-medium">
                    {item.registered_payment_count}
                  </td>
                  <td className="p-3 border-b border-gray-100">
                    {item.payment_mobile_count}
                  </td>
                  <td className="p-3 border-b border-gray-100 text-red-500">
                    {item.refund_count}
                  </td>
                  <td className="p-3 border-b border-gray-100">
                    {item.login_status_count}
                  </td>
                </tr>
              ))
            )}
          </tbody>
        </table>
      </div>

      <div className="mt-4 text-sm text-gray-500">
        Last updated: {new Date().toLocaleString()}
      </div>
    </div>
  );
};

export default DateWiseCount;
